    protected static HashMap<String, String> indexStorageMap(List<String> list){
        HashMap<String, String> duplicatedIndex = new HashMap<>();
        for (int i = 0; i < list.size(); i++) {
            if (!duplicatedIndex.containsKey(list.get(i))){
                duplicatedIndex.put(list.get(i), String.valueOf(i));
            } else {
                duplicatedIndex.put(list.get(i), duplicatedIndex.get(list.get(i)) +"-" + String.valueOf(i));
            }
        }
        return duplicatedIndex;
    }

    protected static String getDuplicatedIndexList(List<String> list, String key){

        return indexStorageMap(list).get(key);
    }

